import React from 'react';
import './JogoDaVelha.css';

function JogoDaVelha() {
  return (
    <main>
      <h1 className="title"> Jogo da velha </h1>
      <div className="board">
        <div key="1" className="cell"></div>
        <div key="2" className="cell"></div>
        <div key="3" className="cell"></div>
        <div key="4" className="cell"></div>
        <div key="5" className="cell"></div>
        <div key="6" className="cell"></div>
        <div key="7" className="cell"></div>
        <div key="8" className="cell"></div>
        <div key="9" className="cell"></div>
      </div>
    </main>

    );
}

export default JogoDaVelha;
